import React, { useEffect, useState } from 'react';
import api from '../../utils/api';
import './BatchProcessing.scss';  // Import the SCSS styles

const BatchProcessing = ({ gpsData }) => {
  const [processedData, setProcessedData] = useState(null);

  useEffect(() => {
    if (gpsData.length > 0) {
      processBatch(gpsData);
    }
  }, [gpsData]);

  const processBatch = async (batch) => {
    try {
      const driver_id = localStorage.getItem('driver_id');
      const response = await api.post('/record-telematics', { driver_id, gps_data: batch });
      setProcessedData(response.data);
    } catch (error) {
      console.error('Error processing batch:', error);
    }
  };

  return (
    <div className="batch-processing-container">
      <h3>Batch Processing</h3>

      {processedData ? (
        <div className="processed-data">
          <p>Processed batch data successfully!</p>

          <div className="summary-item">
            <strong>Trip ID:</strong> {processedData.trip_id}
          </div>
          <div className="summary-item">
            <strong>Driving Score:</strong> {processedData.driving_score} / 100
          </div>
          <div className="summary-item">
            <strong>Driving Category:</strong> {processedData.driving_category}
          </div>

          <h4>Processed Features:</h4>
          <div className="summary-item">
            <strong>Speed (m/s):</strong> {processedData.features['Speed(m/s)']}
          </div>
          <div className="summary-item">
            <strong>Acceleration (m/s²):</strong> {processedData.features['Acceleration(m/s^2)']}
          </div>
          <div className="summary-item">
            <strong>Jerk (m/s³):</strong> {processedData.features['Jerk(m/s^3)']}
          </div>
          <div className="summary-item">
            <strong>Braking Intensity:</strong> {processedData.features['Braking_Intensity']}
          </div>
          <div className="summary-item">
            <strong>SASV:</strong> {processedData.features['SASV']}
          </div>
          <div className="summary-item">
            <strong>Speed Violation:</strong> {processedData.features['Speed_Violation']}
          </div>
        </div>
      ) : (
        <p>No batch processed yet.</p>
      )}
    </div>
  );
};

export default BatchProcessing;
